import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";

export default class Header extends Component {
  render() {
    return (
      <div>
        <div className="name-main">Ensalada de Tomate</div>
        <div className="price">5.50€</div>
        <div>Aceite de Oliva y Ajo</div>

        <svg>
        <line x1="5" x2="390" y1="50" y2="50" stroke="black" stroke-width="1" stroke-linecap="butt"/>
        </svg>
        <div>Ensalada de Gulas</div>
        <div>Gulas Tomate Lechuga y Ajo</div>
        <div>8.00€</div>
      </div>
    );
  }
}
